/* Actualiza D_PIEZAS_DENTALES. */
-- Actualiza valores existentes. UPDATE D_PIEZAS_DENTALES SET de_pieza_dental = H.W20DES FROM D_PIEZAS_DENTALES P JOIN HOST03.HOST03.SMPORDD.M20FEOD H on P.id_pieza_dental = W20COD
-- Inserta nuevos valores. INSERT INTO D_PIEZAS_DENTALES (id_pieza_dental, de_pieza_dental) SELECT W20COD as id_pieza_dental, W20DES as de_pieza_dental FROM HOST03.HOST03.SMPORDD.M20FEOD WHERE W20COD not in (select distinct id_pieza_dental from D_PIEZAS_DENTALES)
